import React, { Component } from 'react';
import Particles from 'react-particles-js';
import './App.css';

class App extends Component {
  render(){
    return (
      <div className='body'>
        <h1>Hello</h1>
        <Particles 
                params={{
                    particles: {
                        shape: {
                            type: 'images',
                            images: [
                                {src: 'path/to/first/image.svg', height: 20, width: 20},
                                {src: 'path/to/second/image.jpg', height: 20, width: 20},
                            ]
                        }
                    }
                }} />

      </div>
    );
  }
}
export default App;
